import React, {Component} from 'react';
import {ListItem,
    ListInfo} from '../style';

class List extends Component {
    render() {
        return (
            <ListItem>
                <img className = 'pic' alt = 'no support' src = '//upload-images.jianshu.io/upload_images/16564498-21b04f185fc704bc.png?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240'></img>
                <ListInfo>
                    <h3>一半人觉得她美艳绝伦，一半人觉得她长相清奇难以接受</h3>
                    <p>1.不要抱怨,抱我 2、最近有谣言说我喜欢你,我要澄清一下,那不是谣言 3.我怀疑你的本质是一本书,不然为什么让我越看越想睡 4...</p>
                </ListInfo>
            </ListItem>
        )
    }
}

export default List;
